  <div><b>Distance:</b> <span id="dist-val">0</span> m</div>

 <script>
document.addEventListener('DOMContentLoaded', function() {
  var mapObj = YOUR_MAP_OBJECT_NAME;  // already in your file

  var latitudes = [/* filled by Python */];
  var longitudes = [/* filled by Python */];
  var cumdist = [/* filled by Python */];
  var totalDist = TOTAL_DISTANCE;      // filled by Python
  var totalTime = 2052.0;              // your flight time
  var speedFactor = totalTime / 60.0;  // or whatever you had

  if (latitudes.length < 2) return;

  var marker = L.circleMarker(
    [latitudes[0], longitudes[0]],
    { radius: 5, color: 'yellow', fillColor: 'yellow', fillOpacity: 1 }
  ).addTo(mapObj);

  var startReal = null;

  // NEW: track last distance/time for instantaneous ground speed
  var lastSimT = 0.0;
  var lastDist = 0.0;

  function frame(ts) {
    if (!startReal) startReal = ts;
    var elapsed = (ts - startReal) / 1000.0;       // real seconds
    var simT = elapsed * speedFactor;              // simulated seconds along route

    if (simT >= totalTime) {
      // Snap to final point & zero speed
      marker.setLatLng([
        latitudes[latitudes.length-1],
        longitudes[longitudes.length-1]
      ]);
      document.getElementById('dist-val').textContent = totalDist.toFixed(0);
      document.getElementById('time-val').textContent = totalTime.toFixed(1);
      document.getElementById('speed-val').textContent = "0.0";
      document.getElementById('speed-kmh-val').textContent = "0.0";
      return;
    }

    var targetDist = (simT / totalTime) * totalDist;

    // Find segment
    var i = 0;
    while (i < cumdist.length - 1 && cumdist[i+1] < targetDist) i++;

    var d0 = cumdist[i];
    var d1 = cumdist[i+1];
    var r = (targetDist - d0) / Math.max(1e-6, (d1 - d0));

    var lat = latitudes[i] + r * (latitudes[i+1] - latitudes[i]);
    var lon = longitudes[i] + r * (longitudes[i+1] - longitudes[i]);

    marker.setLatLng([lat, lon]);

    // Update distance & time
    document.getElementById('dist-val').textContent = targetDist.toFixed(0);
    document.getElementById('time-val').textContent = simT.toFixed(1);

    // NEW: instantaneous ground speed (m/s and km/h)
    var instSpeed = 0.0;
    if (simT > lastSimT + 1e-3) {
      instSpeed = (targetDist - lastDist) / (simT - lastSimT);
      lastSimT = simT;
      lastDist = targetDist;
    }
    if (instSpeed < 0) instSpeed = 0;  // safety clamp

    document.getElementById('speed-val').textContent = instSpeed.toFixed(1);
    document.getElementById('speed-kmh-val').textContent = (instSpeed * 3.6).toFixed(1);

    window.requestAnimationFrame(frame);
  }

  window.requestAnimationFrame(frame);
});
</script>
